  false,\n\t\"url\": null,\n\t\"notes\": \"Multibeam backscatter imagery extracted
  from gridded bathymetry of Rose Island, American Samoa, South Pacific These data
  provide coverage between 20 and 5000 meters. The backscatter dataset includes data
  collected using Simrad EM300 and Reson 8101 multibeam sonars. The sonars frequencies
  are 30 kHz and 240 kHz respectively and the backscatter data from each sonar are
  processed and gridded separately. These metadata are for the 1 m grid cell size
  Reson 8101 multibeam backscatter data only.\",\n\t\"owner_org\": \"e811f0b4-451f-4896-9e8f-fc6802837819\",\n\t\"extras\":
